import { Box, Container, Paper, TableContainer, Table, TableHead, TableRow, TableCell, TableBody } from '@material-ui/core';
import React, { useState, useEffect } from 'react';
import BodyStyle from './body.style';

function Body(props) {
  const styles = BodyStyle();
  const [rows, setRows] = useState([]);

  async function getUsers() {
    try {
      let response = await fetch(
        'http://localhost:8080/user'
      );
      let json = await response.json();
      console.log("hi")
      if (json.item != null) setRows(Array.from(json.item));
      else setRows([]);

    } catch (error) {
      console.error(error);
    }
  };


  useEffect(() => {
    getUsers();
  });

  return (
    <Box className={styles.body} minHeight={props.emptySpace}>
      <Container maxWidth={false}>
      <TableContainer component={Paper} className={styles.container}>
        <Table className={styles.table} size="small" aria-label="user table">
          <TableHead>
            <TableRow>
              <TableCell >USUÁRIO</TableCell>
              <TableCell >EMAIL</TableCell>
              <TableCell >DATA DE INCLUSÃO</TableCell>
              <TableCell >DATA DE ALTERAÇÃO</TableCell>
              <TableCell >REGRAS</TableCell>
              <TableCell >STATUS</TableCell>
              <TableCell >AÇÕES</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow key={row._id}>
                <TableCell component="th" scope="row">
                  {row.username}
                </TableCell>
                <TableCell >{row.email}</TableCell>
                <TableCell >{row.createdAt}</TableCell>
                <TableCell >{row.updatedAt}</TableCell>
                <TableCell >{row.rules}</TableCell>
                <TableCell >{row.status}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      </Container>
    </Box>
  );
}

export default Body;
